import React from 'react';
import { requestExportDocx, requestExportPdf } from '../api/api';

export default function ExportPage() {
  const handleDocx = async () => {
    const r = await requestExportDocx(1);
    window.location.href = r.data.download_url;
  };
  const handlePdf = async () => {
    const r = await requestExportPdf(1);
    window.location.href = r.data.download_url;
  };
  return (
    <div>
      <h2>Export Documents</h2>
      <button onClick={handleDocx}>Download DOCX</button>
      <button onClick={handlePdf}>Download PDF</button>
    </div>
  );
}
